import {
  Autocomplete,
  Button,
  Dialog,
  DialogActions,
  DialogContent,
  DialogTitle,
  TextField,
} from "@mui/material";
import { FunctionComponent, useCallback } from "react";
import { FilterModalProps } from "./types";
import { useForm } from "react-hook-form";
import { CarsProps } from "../../../utils/types/Cars";

function getData(data: CarsProps[], field: any) {
  let response: any[] = [];

  data
    .map((campo) => campo === field)
    .reduce((acc, value) => {
      const result = acc.find((val) => val === value);

      if (!result) response.push(value);
      return acc;
    }, []);

  console.log(response);

  return response;
}

const FilterModal: FunctionComponent<FilterModalProps> = ({
  open,
  onClose,
  onFilter,
  data,
}) => {
  const marca: any[] = data
    .map(({ marca }) => marca)
    .reduce((acc, value) => {
      const result = acc.find((val) => val === value);

      if (result) acc.push(value);
      return acc;
    }, []);
  const { handleSubmit, register } = useForm<CarsProps>();

  const onSubmit = useCallback((data: any) => {
    console.log(data);
  }, []);

  const handleClose = useCallback(() => onClose(), [onClose]);
  return (
    <Dialog open={open} onClose={handleClose}>
      <DialogTitle>Selecione os filtros</DialogTitle>
      <DialogContent>
        <form onSubmit={handleSubmit(onSubmit)}>
          <Autocomplete
            id="free-solo-demo"
            freeSolo
            options={marca}
            renderInput={(params) => (
              <TextField
                {...register("marca", {})}
                name="marca"
                {...params}
                label="Marca"
              />
            )}
          />
        </form>
      </DialogContent>
      <DialogActions>
        <Button onClick={handleClose}>Cancelar</Button>
        <Button type="submit">Filtrar</Button>
      </DialogActions>
    </Dialog>
  );
};

export default FilterModal;
